          let target_index = index + direction in
          match Vec.get_opt env.vec target_index with
          | Some (COMMENT _, _, _) -> count
          | Some (NEWLINE, _, _) ->
              if count >= 2 then count else go target_index (count + 1)
          | None | Some (EOF, _, _) ->
              if direction < 0 then at_file_start := true;
              0
          | Some _ -> count
