    in
    match (!(env.last_unhandled_comment), tok) with
    | _, NEWLINE -> ()
    | Some ci, COMMENT c ->
        handle_comment ci;
        prehandle_comment c
    | None, COMMENT c -> prehandle_comment c
    | Some ci, _ -> handle_comment ci
    | None, _ -> ()

